<!DOCTYPE html>
<html>
<head>
    <meta charset="UTF-8">
    <title>Fasiliti Kesihatan Negeri Johor</title>
    <link rel="stylesheet" href="https://unpkg.com/leaflet/dist/leaflet.css"/>
    <style>
        #map {
            height: 90vh;
            width: 100%;
        }
        .info {
            position: absolute;
            top: 10px;
            right: 10px;
            background: white;
            padding: 6px;
            border-radius: 4px;
            box-shadow: 0 0 15px rgba(0,0,0,0.2);
            z-index: 1000; /* Ensure it's above the map */
        }
        .facility-list {
            margin-top: 5px;
            font-size: 0.9em;
        }
        .facility-list ul {
            list-style-type: disc;
            margin-left: 20px;
            padding: 0;
        }
        .facility-list li {
            margin-bottom: 2px;
        }
        /* New style for popup content font size */
        .leaflet-popup-content-wrapper .leaflet-popup-content {
            font-size: 1.1em; /* Adjust this value as needed (e.g., 16px, 1.2em) */
        }

                /* --- ADDED: Custom marker styles for different categories --- */
        .hospital-marker {
            background-color: #e41a1c; /* Red color for hospitals */
            border-radius: 50%; /* Make it a circle */
            width: 15px;
            height: 15px;
            border: 2px solid white;
            box-shadow: 0 0 5px rgba(0,0,0,0.5);
        }
        .clinic-marker {
            background-color: #377eb8; /* Blue color for clinics */
            border-radius: 50%; /* Make it a circle */
            width: 15px;
            height: 15px;
            border: 2px solid white;
            box-shadow: 0 0 5px rgba(0,0,0,0.5);
        }
        /* Default marker style if needed */
        .default-marker {
            background-color: #4daf4a; /* Green color for default */
            border-radius: 50%;
            width: 15px;
            height: 15px;
            border: 2px solid white;
            box-shadow: 0 0 5px rgba(0,0,0,0.5);
        }
        /* --- END ADDED CSS --- */
           /* --- ADDED: Legend specific CSS --- */
        .legend {
            line-height: 18px;
            color: #555;
            background-color: white;
            padding: 6px 8px;
            border-radius: 4px;
            box-shadow: 0 0 15px rgba(0,0,0,0.2);
        }
        .legend i {
            width: 18px;
            height: 18px;
            float: left;
            margin-right: 8px;
            opacity: 0.7;
            border-radius: 50%; /* Match marker shape */
            border: 1px solid #ccc; /* Optional: add a light border for contrast */
        }
        /* --- END ADDED CSS --- */     
    </style>
</head>

        // Custom control for info box
        var info = L.control();

        info.onAdd = function (map) {
            this._div = L.DomUtil.create('div', 'info');
            this.update();
            return this._div;
        };

        info.update = function (props) {
            let content = 'Hover atas daerah untuk info';
            if (props && props.Parliament) {
                const parliamentName = props.Parliament;
                const population = popData[parliamentName] ? popData[parliamentName].toLocaleString() : 'N/A';
                // *** CORRECTED: Use facilitiesData here ***
                const facilities = facilitiesData[parliamentName];

                content = `<b>${parliamentName}</b><br>Pop: ${population}`;

                if (facilities && facilities.length > 0) {
                    let facilitiesHtml = '<div class="facility-list"><b>Facilities:</b><ul>';
                    facilities.forEach(facility => {
                        // For the info box, we just display the name for now (no links)
                        facilitiesHtml += `<li>${facility.name}</li>`;
                    });
                    facilitiesHtml += '</ul></div>';
                    content += facilitiesHtml;
                } else {
                    content += '<div class="facility-list">No facilities listed.</div>';
                }
            }
            this._div.innerHTML = content;
        };

        info.addTo(map);

        // Function to define initial style for GeoJSON polygons
        function style(feature) {
            return {
                fillColor: '#800026', // Initial fill color (dark red)
                weight: 2,
                opacity: 1,
                color: 'white',
                dashArray: '3',
                fillOpacity: 0.7
            };
        }

        // Function to handle feature events (e.g., hover)
        function onEachFeature(feature, layer) {
            layer.on({
                mouseover: function(e) {
                    var layer = e.target;
                    layer.setStyle({
                        fillColor: '#5C71FF', // New fill color on hover (light blue)
                        weight: 4, // Thicker border on hover
                        color: '#666',
                        dashArray: '',
                        fillOpacity: 0.9
                    });

                    if (!L.Browser.ie && !L.Browser.opera && !L.Browser.edge) {
                        layer.bringToFront();
                    }
                    info.update(layer.feature.properties);
                },
                mouseout: function(e) {
                    geojson.resetStyle(e.target);
                    info.update(); // Clear info box on mouse out
                },
                click: function(e) {
                    map.fitBounds(e.target.getBounds());
                }
            });

            // Bind popup with detailed information for the parliamentary area
            if (feature.properties && feature.properties.Parliament) {
                var parliamentName = feature.properties.Parliament;
                var population = popData[parliamentName] ? popData[parliamentName].toLocaleString() : 'N/A';
                // *** CORRECTED: Use facilitiesData here ***
                var facilities = facilitiesData[parliamentName];
                let popupContent = `<b>${parliamentName}</b><br>Pop: ${population}`;

                if (facilities && facilities.length > 0) {
                    popupContent += '<br><b>Facilities:</b><ul>';
                    facilities.forEach(facility => {
                        // Conditionally create anchor tag based on 'url' property
                        if (facility.url) {
                            popupContent += `<li><a href="${facility.url}">${facility.name}</a></li>`;
                        } else {
                            popupContent += `<li>${facility.name}</li>`;
                        }
                    });
                    popupContent += '</ul>';
                } else {
                    popupContent += '<div class="facility-list">No facilities listed.</div>';
                }
                layer.bindPopup(popupContent);
            }
        }

        // *** NEW: Loop through the allMarkersData and add markers to the map ONCE ***
        // This loop should be outside onEachFeature
        // --- MODIFIED: Loop through allMarkersData and add markers with category-specific icons ---
        allMarkersData.forEach(function(facility) {
            let currentIcon;
            switch (facility.category) {
                case "Hospital":
                    currentIcon = hospitalIcon;
                    break;
                case "Clinic":
                    currentIcon = clinicIcon;
                    break;
                default:
                    currentIcon = defaultIcon; // Fallback for uncategorized facilities
            }

            var marker = L.marker([facility.lat, facility.lng], { icon: currentIcon }).addTo(map);

            // Create popup content for the marker
            let markerPopupContent = `<b>${facility.name}</b><br>`;
            if (facility.description) {
                markerPopupContent += `${facility.description}<br>`;
            }
            if (facility.url) {
                markerPopupContent += `<a href="${facility.url}">More Info</a>`;
            }
            if (facility.category) { // Display category in popup
                markerPopupContent += `<br>Category: ${facility.category}`;
            }

            marker.bindPopup(markerPopupContent);
        });
